    while (it.hasNext()) {
        final PkgControl pc = (PkgControl) it.next();
        final PkgControl match = pc.locateFinest(aForPkg);
        if (match != null) {
            return match;
        }
    }

    // No match so I am the best there is.
    return this;
}
